A Spy is more skilled in the arts of espionage than her Diplomat predecessor.She can perform all the functions of the Diplomat; refer to the Diplomat entry for more details. Unlike a Diplomat, a Spy may also survive an operation in a foreign city and become more experienced as a result. Spies are also more effective than Diplomats at defending cities against foreign Diplomats and Spies.A Spy can also be used to:
 - sabotage an enemy unit (reducing its hit points to half), if it is alone on a tile and the players are at war;
 - poison the water supply of an enemy city (reducing the population by one);
 - steal specific technology (with a reduced chance of success);
 - steal further technologies from a city which has already been stolen from (although cities become more resistant each time they are stolen from);
 - sabotage predetermined city targets (with a reduced chance of success).A Spy that survives the more aggressive actions (sabotage, theft, inciting rebellion, and poisoning) escapes to the safety of the nearest friendly city.Spies built under a Communist government will start at the first veteran level (handler).
